import style from './cart.module.css';


const overlayObj=[
    {
        id:'1',
        title: "Название",
        price:"36 000",
        img:"/img/1.jpeg"
    },
    {
        id:'2',
        title: "Название 2",
        price:"36 000",
        img:"/img/1.jpeg"
    }, 
    {
        id:'3',
        title: "Название 3",
        price:"36 000",
        img:'/img/1.jpeg'
    }
]


const Cart = () => {
    return (
        <div className={style.cart_section}>
            <div className={style.search}>
                <h1>Туры:</h1>
                <div className={style.search_block}>
                    <img src="/img/search.png" alt="поиск"></img>
                    <input placeholder="Поиск"></input>
                </div>
            </div>

            <div className={style.cart}>

                <Product title="СПА ОТЕЛЬ АКВАГРАД" price="36 000" img="/img/1.jpeg" />

            </div>
        </div>
    )
}

export default Cart
